create table localidad(id int primary key, nom_localidad varchar(70));
create table categ_eleccion(id int primary key, nom_categoria varchar(40)); --1:gobernador 2:diputados 3:consejo magistratura 4:intendente 5:concejales
create table seccion(id int primary key, nombre varchar(50)); --1..15 - dptos de provincia
create table circuito(id int primary key, letra varchar(1),secc_id int not null,nombre varchar(50), localidad_id int not null);-- 1..
create table escuela(id int primary key, circ_id int not null,nom_escuela varchar(60), direccion varchar(80), localidad_id int not null);
create table mesa(id int primary key, nro_mesa int not null, circ_id int not null, esc_id int not null, cant_electores int);
create table partido(id serial primary key,nro_partido int, nom_partido varchar(60), color varchar(15));
create table lista_partido(id serial primary key, partido_id int , nom_lista varchar(70)); -- chubut al frente, cambiemos, frente patriotico
create table lista_partido_localidad(id serial primary key, lista_partido_id int not null, categoria_id int not null, localidad_id int not null); -- donde se presenta la lista de un partido(que localidad)
create table telegrama_acta(id serial primary key,nro_mesa int not null, fecha date, cargado smallint ); 
create table telegrama_acta_votos(id serial primary key, teleg_id int not null,lista_partido_loc_id int not null, votos int not null); 
create table categoria_eleccion_localidad(id serial primary key, localidad_id int, elige_gob smallint not null, elige_dip smallint not null, elige_cm smallint not null, elige_int smallint not null, elige_cd smallint not null, elige_jc smallint not null);
--agregar restriccion de claves foraneas.
alter table circuito add constraint fk_circuito_seccion foreign key(secc_id) references seccion(id);
alter table circuito add constraint fk_circuito_localidad foreign key(localidad_id) references localidad(id);
alter table escuela add constraint fk_escuela_circuito foreign key(circ_id) references circuito(id);
alter table escuela add constraint fk_escuela_localidad foreign key(localidad_id) references localidad(id);
alter table mesa add constraint fk_mesa_circuito foreign key(circ_id) references circuito(id);
alter table mesa add constraint fk_mesa_escuela foreign key(esc_id) references escuela(id);
alter table lista_partido add constraint fk_lista_partido_partido foreign key(partido_id) references partido(id);
alter table lista_partido_localidad add constraint fk_lista_partido_localidad_lista_partido foreign key(lista_partido_id) references lista_partido(id);
alter table lista_partido_localidad add constraint fk_lista_partido_localidad_categ_eleccion foreign key(categoria_id) references categ_eleccion(id);
alter table lista_partido_localidad add constraint fk_lista_partido_localidad_localidad foreign key(localidad_id) references localidad(id);
alter table telegrama_acta add constraint fk_telegrama_acta_mesa foreign key(nro_mesa) references mesa(id);
alter table telegrama_acta_votos add constraint fk_telegrama_acta_votos_telegrama foreign key(teleg_id) references telegrama_acta(id);
alter table telegrama_acta_votos add constraint fk_telegrama_acta_votos_lista_partido_localidad foreign key(lista_partido_loc_id) references lista_partido_localidad(id);

